import React from "react";
import {Route, Switch} from "react-router-dom";
import {BrowserRouter} from "react-router-dom";
// import ListArticle from "../components/list-article";

import Home from "../pages/home";
// import News from "../pages/NewsCategory";
// import ListArticleData from "../pages/list-article-data";
import Login from "../pages/login";


const MainRoute = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path="/" component={Home}/>
                <Route exact path="/login" component={Login}/>
                {/* <Route exact path="/list-article" component={ListArticle}/>
                <Route path="/news-category/:category" component={NewsCategory}/> */}
                {/* <Route exact path="/list-article-data" component={ListArticleData}/> */}
            </Switch>
        </BrowserRouter>
    )
}
export default MainRoute;
